// src/App.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import 'boxicons/css/boxicons.min.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom'
import AuthBar from './components/authbar'
import NavBar from './components/navbar'
import Carousel from './components/corousel'
import TagLine from './components/taglines'
import Collection from './components/collection';
import Launches from './components/newLaunches';
import Footer from './components/footer';
import Derbies from './components/derbies-new';
import Movers from './components/movers-men';
import Slipon from './components/slipon-women';
import Login from './components/login'
import Signup from './components/Signup'


function Home() {
  return (
    <>
      <Carousel />
      <TagLine />
      <Collection />
      <Launches />
      <Footer />
    </>
  );
}

function App() {
  const { user } = useAuthContext()

  return (
    <div className="app">
      <BrowserRouter>
        <AuthBar />
        <NavBar />
        <Routes>
          <Route path='/'

            element={user ? <Home /> : <Navigate to="/login" />} />

          <Route path='/login' element={<Login />} />
          <Route path='/signup' element={<Signup />} />
          <Route path='/derbies'
            element={<Derbies />} />
          <Route path='/movers'
            element={<Movers />} />
          <Route path='/slipon'
            element={<Slipon />} />
        </Routes>
      </BrowserRouter>
    </div>
  )
}

export default App;
